// Override the shared.js createSquares function to match our needs
function createSquares() {
  const gameBoard = document.querySelector("#board");
  if (!gameBoard) return; // Safety check

  for (let i = 0; i < 6; i++) {
    const row = document.createElement("div");
    row.classList.add("row");
    row.setAttribute("id", `row_${i}`);
    for (let j = 0; j < 5; j++) {
      const square = document.createElement("div");
      square.classList.add("square");
      square.classList.add("animate__animated");
      square.setAttribute("id", `square_${i}_${j}`);
      square.addEventListener("mousedown", changeColourMap);
      row.appendChild(square);
    }
    gameBoard.appendChild(row);
  }
}

function changeColourMap(e) {
  const squareID = e.target.id;
  const [row, column] = squareID.match(/\d/g);
  if (row == guessedWords.length - 1) {
    if (currentColourMap.join("") == 33333) {
      currentColourMap = [0,0,0,0,0]
    } else {
      currentColourMap[column] = (currentColourMap[column] + 1)%4;
    }
    e.target.parentElement.childNodes.forEach((child, index) => child.classList = "square " + numToColour[currentColourMap[index]]);
  }
}

// createSquares() is now called by shared.js after the board is created

function arraysEqual(a, b) {
  if (a === b) return true;
  if (a == null || b == null) return false;
  if (a.length !== b.length) return false;

  for (let i = 0; i < a.length; i++) {
    if (a[i] !== b[i]) return false;
  }
  return true;
}

